<!DOCTYPE html>
<!-- saved from url=(0046)https://zoom.ada.support/chat/connect/?embed=1 -->
<html lang="en"><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    <script>
      var localChatter = null;
      var sessionChatter = null;
      try {
        localChatter = JSON.parse(localStorage.getItem("chatter"));
        sessionChatter = JSON.parse(sessionStorage.getItem("chatter"));
      } catch (e) {}
      window.parent.postMessage(
        {
          chatterIds: {
            local: localChatter,
            session: sessionChatter
          }
        },
        "*"
      );
    </script>
    <title>Con</title>
  </head>
  <body style="margin:0;">
  

</body></html>
